void myproject::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"input_1_V\" :  \"" << input_1_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"input_1_V_ap_vld\" :  \"" << input_1_V_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"layer3_out_0_V\" :  \"" << layer3_out_0_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"layer3_out_0_V_ap_vld\" :  \"" << layer3_out_0_V_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"layer3_out_1_V\" :  \"" << layer3_out_1_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"layer3_out_1_V_ap_vld\" :  \"" << layer3_out_1_V_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"layer3_out_2_V\" :  \"" << layer3_out_2_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"layer3_out_2_V_ap_vld\" :  \"" << layer3_out_2_V_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"layer3_out_3_V\" :  \"" << layer3_out_3_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"layer3_out_3_V_ap_vld\" :  \"" << layer3_out_3_V_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"layer3_out_4_V\" :  \"" << layer3_out_4_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"layer3_out_4_V_ap_vld\" :  \"" << layer3_out_4_V_ap_vld.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

